import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import React from 'react';

function App() {
  return (
    <Router>
    <div className='App'>
      <Route path="/" component="{Homepage}" exact />
    </div>
    </Router>
  );
}

export default App;
